create table brands (
    brand_id int primary key,
    brand_name varchar(255) not null
);

create table categories (
	category_id int primary key,
	category_name varchar(255) not null
);

create table customers (
	customer_id int primary key,
	first_name varchar(255) not null,
	last_name varchar(255) not null,
	phone varchar(25),
	email varchar(255) not null,
	street varchar(255),
	city varchar(50),
	state varchar(25),
	zip_code varchar(5)
);

create table stores (
	store_id int primary key,
	store_name varchar(255) not null,
	phone varchar(25),
	email varchar(255),
	street varchar(255),
	city varchar(255),
	state varchar(10),
	zip_code varchar(5)
);

create table products (
	product_id int primary key,
	product_name varchar(255) not null,
	brand_id int,
	category_id int,
	price number(10, 2) not null,
	model_year int not null,
	constraint brand_product foreign key (brand_id) references brands(brand_id),
   constraint category_product foreign key (category_id) references categories(category_id)
);

CREATE TABLE staffs (
	staff_id int PRIMARY KEY,
	first_name VARCHAR(50) NOT NULL,
	last_name VARCHAR(50) NOT NULL,
	email VARCHAR(255) NOT NULL UNIQUE,
	phone VARCHAR (25),
	active int NOT NULL,
	store_id INT NOT NULL,
	manager_id INT,
	constraint store_staff foreign key (store_id) references stores(store_id),
   constraint manager_staff foreign key (staff_id) references staffs(staff_id)
);

CREATE TABLE orders (
	order_id INT PRIMARY KEY,
	customer_id INT,
	order_status INT NOT NULL,
	-- Order status: 1 = Pending; 2 = Processing; 3 = Rejected; 4 = Completed
	order_date DATE NOT NULL,
	required_date DATE NOT NULL,
	shipped_date DATE,
	store_id INT NOT NULL,
	staff_id INT NOT NULL,
	constraint customer_order foreign key (customer_id) references customers(customer_id),
   constraint store_order foreign key (store_id) references stores(store_id),
   constraint staff_order foreign key (staff_id) references staffs(staff_id)
);

CREATE TABLE order_items (
	order_id INT,
	item_id INT,
	product_id INT NOT NULL,
	quantity INT NOT NULL,
	list_price number(10, 2) NOT NULL,
	discount number(4, 2) NOT NULL,
	constraint pk_item primary key (order_id, item_id),
	constraint order_item foreign key (order_id) references orders(order_id),
   constraint product_item foreign key (product_id) references products(product_id)
);

